  \"2015-09-01T18:22:04.634129\",\n\t\"name\": \"price-spreads-from-farm-to-consumer\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"USDA Economic Research Service (ERS) compares
  prices paid by consumers for food with prices received by farmers for corresponding
  commodities. This data set reports these comparisons for a variety of foods sold
  through retail food stores such as supermarkets and super centers. Comparisons are
  made for individual foods and groupings of individual foods-market baskets-that
  represent what a typical U.S. household buys at retail in a year. The retail costs
  of these baskets are compared with the money received by farmers for a corresponding
  basket of agricultural commodities.\",\n\t\"license_title\": \"Creative Commons
